import './App.css';
import Contacto from './components/Contacto';
import Nosotros from './components/Nosotros';
import Inicio from './components/Inicio';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  NavLink
} from "react-router-dom";

function App() {
  return (
    <div>
      <h1>Natvbar</h1>

      <Router>



        <Switch>
          <Route path="/contacto">
              <Contacto/>
          </Route>
          <Route path="/nosotros">
              <Nosotros/>
          </Route>
          <Route path="/">
              <Inicio/>
          </Route>
        </Switch>

      </Router>


    </div>
  );
}

export default App;
